import React from 'react';
import { Descriptions } from 'antd';
import { Typography } from 'antd';
import 'antd/dist/antd.css';

import {Logo, CoordinateInformation} from './components';
const { Title } = Typography;

class Devis extends React.Component{

    constructor(){
        super();
        this.state = {
            jsonDevis:{},
            company: {}
        }
    }

    componentWillMount(){
     fetch("https://api.travauxlib.com/api/devis-pro/JKusHl8Ba8MABIjdCtLZOe2lxxnUfX")
    .then(response=>response.json())
    .then(data=>this.setState({
        company: data.company,
        title : data.title
    }

        ));


    }

    render(){

        return(
            <>
        <Logo url={this.state.company.logoUrl}/>
        <CoordinateInformation name={this.state.company.name} email={this.state.company.email} 
        adress={this.state.company.adress+' '+this.state.company.city}/>
        </>

        );

    }
}


